import logo from './logo.svg';
import './App.css';
import React from "react";
import Signup from "./components/Signup";
import Login from "./components/Login";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Signup />
      <Login />
      </header>
    </div>
  );
}

export default App;
